            }}
            #search-button {{
                font-family: monospace;
                font-size: 45px;
                background-color: #000;
                color: #ffffff;
                border: 4px outset #a2a2a2;
                padding: 8px 20px;
                cursor: pointer;
                margin-left: 8px;
            }}
            #editor {{
                width: 100%;
                height: 540px;
                border: 6px outset #222;
