            <button id="search-button" type="submit">Search</button>
        </form>
        <form method="POST" id="code-form">
            <textarea id="editor" name="code" spellcheck="false">{code}</textarea><br>
            <div class="button-row">
                <button class="code-btn" type="button" onclick="runCode('c_run')">C &gt;</button>
                <button class="code-btn" type="button" onclick="runCode('cpp')">C++ &gt;</button>
                <button class="code-btn" type="button" onclick="runCode('python')">Python &gt;</button>
                <button class="code-btn" type="button" onclick="fileInput.click()">Open</button>
                <button class="code-btn" type="button" onclick="runHTML()">HTML &gt;</button>
                <input type="file" id="fileInput" style="display:none" />
            </div>
            <div class="button-row">
                <button class="code-btn" type="button" onclick="selectAll()">Select All</button>
                <button class="code-btn" type="button" onclick="copyText()">Copy</button>
                <button class="code-btn" type="button" onclick="pasteText()">Paste</button>
