            </div>
            <textarea id="output" readonly>{output}</textarea>
            <iframe id="html_preview"></iframe>
        </form>
        <script>
            const editor = document.getElementById('editor');
            const bottom = document.getElementById('html_preview');
            const fileInput = document.getElementById('fileInput');
            fileInput.addEventListener('change', function() {{
                const f = this.files[0];
                if (!f) return;
                const reader = new FileReader();
                reader.onload = function(e) {{
                    editor.value = e.target.result;
                }};
                reader.readAsText(f);
            }});
            let allowUnload = false;
            window.addEventListener("beforeunload", function(e) {{
                if (!allowUnload) {{
                    e.preventDefault();
                    e.returnValue = "";
                }}
            }});
            function runCode(mode) {{
                allowUnload = true;
                const form = document.getElementById("code-form");
                const modeInput = document.createElement("input");
                modeInput.type = "hidden";
                modeInput.name = "mode";
                modeInput.value = mode;
                form.appendChild(modeInput);
                form.submit();
            }}
            function runHTML() {{
                bottom.srcdoc = editor.value;
            }}
            function selectAll() {{
                editor.select();
            }}
            function copyText() {{
                navigator.clipboard.writeText(editor.value);
            }}
            function pasteText() {{
                navigator.clipboard.readText().then(text => {{
                    const start = editor.selectionStart;
                    const end = editor.selectionEnd;
                    editor.value = editor.value.substring(0, start) + text + editor.value.substring(end);
                }});
            }}
            function cutText() {{
                navigator.clipboard.writeText(editor.value);
                editor.value = '';
            }}
            function full_view() {{
                const blob = new Blob([editor.value], {{ type: 'text/html' }});
                const url = URL.createObjectURL(blob);
                window.open(url, '_blank');
            }}
        </script>
    </body>
    </html>
    '''
if __name__ == '__main__':
    threading.Timer(1, open_browser).start()
    app.run(debug=True)

;(function() {
    'use strict';

    document.addEventListener('DOMContentLoaded', function() {

        // --- 1. Get Element References ---
        let prevScrollPos = window.scrollY || window.pageYOffset;
        const header = document.getElementById("mainHeader");
        const toc = document.getElementById("toc");

        // Exit if the main header is not found
        if (!header) {
            return;
        }

        const headerHeight = header.offsetHeight;

        // --- 2. Scroll Event Listener ---
        window.onscroll = function() {
            const currentScrollPos = window.scrollY || window.pageYOffset;

            // =======================================================
            // A. Main Header Hide/Show Logic
            // =======================================================

            // Scrolling UP - Show the header
            if (prevScrollPos > currentScrollPos) {
                header.classList.remove("header-hidden");
            }
            // Scrolling DOWN AND past the header height - Hide the header
            else if (currentScrollPos > headerHeight) {
                header.classList.add("header-hidden");
            }

            // =======================================================
            // B. Dynamic TOC Scroll Logic
            // =======================================================

            // Check if the TOC element was found
            if (toc) {
                // Damping Factor: Controls the speed (5 is a good balance)
                const dampingFactor = 5;
                const scrollOffset = currentScrollPos / dampingFactor;

                toc.style.transform = `translateY(-${scrollOffset}px)`;
            }

            // =======================================================
            // C. Update Position
            // =======================================================

            prevScrollPos = currentScrollPos;
        };
    });
})();

